gPS(){return"\u041f\u0430\u043d\u0442\u0435\u043b\u0435\u0439\u043c\u043e\u043d\u0456\u0432 \u043a\u043e\u0434\u0435\u043a\u0441, \u0442\u0430\u043a\u043e\u0436 \u0432\u0456\u0434\u043e\u043c\u0438\u0439 \u044f\u043a \u0423\u043d\u0446\u0456\u0430\u043b 052, \u0454 \u0433\u0440\u0435\u0446\u044c\u043a\u0438\u043c \u0443\u043d\u0446\u0456\u0430\u043b\u044c\u043d\u0438\u043c \u0440\u0443\u043a\u043e\u043f\u0438\u0441\u043e\u043c \u041d\u043e\u0432\u043e\u0433\u043e \u0417\u0430\u043f\u043e\u0432\u0456\u0442\u0443. \u0412\u0456\u043d \u043c\u0456\u0441\u0442\u0438\u0442\u044c \u0444\u0440\u0430\u0433\u043c\u0435\u043d\u0442 \u0442\u0435\u043a\u0441\u0442\u0443 \u041e\u0431'\u044f\u0432\u043b\u0435\u043d\u043d\u044f \u0437 \u043a\u043e\u043c\u0435\u043d\u0442\u0430\u0440\u0435\u043c \u0410\u043d\u0434\u0440\u0456\u044f \u041a\u0435\u0441\u0430\u0440\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e, \u043d\u0430\u043f\u0438\u0441\u0430\u043d\u0438\u0439 \u043d\u0430 4 \u043f\u0435\u0440\u0433\u0430\u043c\u0435\u043d\u0442\u043d\u0438\u0445 \u0430\u0440\u043a\u0443\u0448\u0430\u0445 \u0440\u043e\u0437\u043c\u0456\u0440\u043e\u043c 29,5 x 23 \u0441\u043c."},
